import { BrowserRouter, Routes, Route } from "react-router-dom";
// import App from './App'
import Login  from "./pages/login";

const Router = () => {
  return (
    <BrowserRouter basename="index.html">
      <Routes>
        <Route path="/" exact element={Login}/>
      </Routes>
    </BrowserRouter>
  );
};


export default Router
